module.exports = {
  name: `flatpak-builder`,
  factory: require => {
    const { BaseCommand } = require(`@yarnpkg/cli`);
    const { Configuration, structUtils, tgzUtils } = require('@yarnpkg/core')
    const { ZipFS } = require('@yarnpkg/fslib');
    const { getLibzipPromise } = require('@yarnpkg/libzip');
    const fs = require('fs');

    class convertToZipCommand extends BaseCommand {
      static paths = [[`convertToZip`]];

      async execute() {
        const configuration = await Configuration.find(this.context.cwd,
          this.context.plugins);
        //const lockfile = configuration.get('lockfileFilename');
        const cacheFolder = configuration.get('cacheFolder');
        const compressionLevel = configuration.get(`compressionLevel`);

        this.context.stdout.write(`yarn cacheFolder: ${cacheFolder}\n`);

        const convertToZip = async (tgz, target, opts) => {
          const { compressionLevel, ...bufferOpts } = opts;
          const zipFs = new ZipFS(target, {
            create: true,
            libzip: await getLibzipPromise(),
            level: compressionLevel
          });
          const tgzBuffer = fs.readFileSync(tgz);
          await tgzUtils.extractArchiveTo(tgzBuffer, zipFs,
            bufferOpts);
          zipFs.saveAndClose();
        }

        this.context.stdout.write(`converting cache to zip\n`);

        const files = fs.readdirSync(cacheFolder);
        const tasks = []
        for (const i in files) {
          const file = `${files[i]}`;
          const tgzFile = `${cacheFolder}/${file}`;

          const match = file.match(/([^-]+)-(.{10}).tgz/);
          if (!match) {
            this.context.stdout.write(`ignore ${file}\n`);
            continue;
          }
          const resolution = Buffer.from(match[1], 'base64').toString();
          const locator = structUtils.parseLocator(resolution, true);
          const sha = match[2];
          const filename =
            `${structUtils.slugifyLocator(locator)}-${sha}.zip`;

          const targetFile = `${cacheFolder}/${filename}`
          tasks.push(async () => {
            return await convertToZip(tgzFile, targetFile, {
              compressionLevel: compressionLevel,
              prefixPath: `node_modules/${structUtils.stringifyIdent(locator)}`,
              stripComponents: 1,
            });
          });
        }
        while (tasks.length) {
          await Promise.all(tasks.splice(0, 32).map(t => t()));
        }
        this.context.stdout.write(`converting finished\n`);
      }
    }

    return {
      commands: [
        convertToZipCommand
      ],
    };
  }
};
